        a9rqNdUsbdI43dGevYDNnP: 'mihalcn@mail.ru',
        aWahm6WPvdWRfXfW11W49N: '11 лет опыта\r\nЧастная юридическая практика (представительство в суде, договорная работа)\r\nКомпетенция и достижения:\r\n1) Подготовка договоров(подряд, поставка, договора в сфере строительства и т.д.), их согласование, контроль исполнения условий)\r\n2)Представительство интересов юридических лиц суде:\r\n-споры о взыскании убытков на стороне ответчика, споры по делам об административным правонарушениям, споры о признании права собственности на земельные участки, споры о признании права собственности на иное недвижимое имущество ,споры об оспаривании ненормативных правовых актов:\r\n-споры в отношении собственности (признание права собственности, признание действительными сделок купли-продажи, признание расписок договором купли-продажи, и т.д.)\r\n- споры о взыскании задолженности на стороне ответчика (снижение суммы задолженности в 20 раз)\r\n3) Успешное представительство интересов физических лиц:\r\n- споры о взыскании ущерба (со стороны ответчика –отказано в удовлетворении)\r\n-споры об оспаривании бездействия должностных лиц\r\n-споры о признании права собственности и т.д.\r\n\r\nГруппа компаний-добыча полезных ископаемых, торговая деятельность\r\nСтарший юрисконсульт\r\nКомпетенция:\r\n1) Корпоративно-правовое сопровождение работы группы компаний (подготовка уставных документов, регистрация юридических лиц, ликвидация юридических лиц, оформление решений, протоколов органов управления ООО, участие в подготовке основных условий сделок (меморандумы о взаимодействии, term-sheets), уставов, подготовка внутренних документов обществ), оформление доверенностей.\r\n2) Подготовка юридических заключений по вопросам земельного права, договорного права, лицензирования в сфере недропользования, недвижимости, трудовому праву 3)Трудовое право (принятие на работу иностранных граждан по трудовому патенту, РВП, уведомление о принятии на работу бывших государственных служащих) \r\n4)Сопровождение сделок с недвижимостью (юридическая экспертиза документов, регистрация права собственности и т.д.)\r\n5)Полное правовое сопровождение («под ключ») прекращения полномочий/назначения ЕИО, смены места нахождения/адреса общества/увеличения уставного капитала, сделок с долями ООО\r\n6)Подготовка договоров (поставки, купли-продажи, аренды, договор аренды земли и т.д.).\r\n7) Представительство интересов компании в арбитражном суде\r\nДостижения:\r\n1) Формирование аккуратного электронного и бумажного архива документов по группе компаний\r\n2)Судебные споры: Разрешен в интересах Компании спор о взыскании с Компании значительной задолженности по кредитному договору в арбитражном суде, завершен процесс оформления права собственности на недвижимое имущество в судебном порядке, признание ненормативных правовых актов недействительными.\r\n3) Полученный опыт и знания при консультировании данного предприятия позволяют мне оценивать перспективы и риски судебного спора на стадии от принятия его в производство судом до вынесения решения кассационной инстанцией.\r\n4) Осуществлена процедура перевода ряда приобретенных земельных участков из одной категории в другую\r\n5) Создано обособленное подразделение наряду с получением адреса в ФИАС, завершен процесс ликвидации ряда юридических лиц.\r\n\r\nГосударственное автономное учреждение Республики Крым\r\nВедущий юрист\r\n Компетенция и достижения:\r\n1)\tОрганизация юридического сопровождения (знание законодательства РФ о градостроительной, производственно-хозяйственной и финансовой деятельности, применение гражданского, хозяйственного и трудового права). \r\n2)\tОпыт применения правовых актов, регулирующих отношения в области строительства и проектирования включает в себя  в т.ч.претензионно-исковую деятельность\r\n3)\tОпыт проведения закупочной деятельности  по Федеральному закону№ 223-ФЗ.\r\n4)\tПретензионно-исковая деятельность.\r\n5)\tВзаимодействие в рамках правовых вопросов со всеми структурными подразделениями на проекте;\r\n6)\tОформление и подготовка правовых заключений дел и составление хозяйственных договоров.\r\n',
