        dcG8kMWPzcJ4k6gLBcR8kj: 'Симферополь, Севастополь,  Москва',
        dcGYaZW4XcL4kRuCkRWRDK: 'Арбитражный, гражданский, административный процесс, договорное право, корпоративное право, недвижимость\r\nСильные качества: Анализирую большой объем информации в условиях решения разноплановых задач. Стараюсь находить нестандартные решения для задач, которые поставлены передо мной.\r\nМоими сильными сторонами являются: аналитические способности, оперативность и самостоятельность в принятии решений, высокая обучаемость, отличные письменные навыки.\r\n\r\nДополнительно: Экспертные публикации на сайте zakon.ru/mihalcn \r\nПрофессиональные публикации в журнале «Юрист компании», «Арбитражная практика для юристов».\r\n\r\nУспешное прохождение курсов: \r\nHarvardx: HLS2X Contract Law: From Trust to Promise to Contract\r\nОнлайн-курс Introduction to English Common Law by London University\r\nОнлайн-курс American Contract Law I by Yale University\r\n',
