        aWahm6WPvdWRfXfW11W49N: 'Образование: \r\n- МГЮА, дневное отд. 1998 (гражданско-правовая специализация);\r\n- Курс повышения квалификации в области налогообложения при Палате налоговых консультантов, 2005 г.\r\n\t\r\nОпыт работы:\r\nЮр. практика с 1998 года.\r\nС 02.2009  по наст. время - Группа компаний "Центр ЮСБ" (г.Москва) - Зам. директора по правовым вопросам уже более 5 лет.\r\nФункционал:  ведение проектов и отдельных судебных дел (арбитраж и СОЮ), письменный консалтинг,  договоры, встречи с клиентами, взаимодействие с регуляторами (Прокуратура, Роскомнадзор, ФССП, и т.д.).\r\nСистематическое представление в процессах российских "дочек" различных международных компаний как на стороне истца, так и ответчика (при необходимости представляются судебные акты, доверенности). Соответственно, знание основной специфики деятельности банков, лизинговых компаний, операторов нежилой недвижимости, оптовых поставщиков  и др.\r\n\r\nРанее сменил 8 мест работы, преимущественно были сферы: оптовая торговля, сдача в аренду торговых площадей, строительство, консалтинг.\r\n\r\n',
