        aWahm6WPvdWRfXfW11W49N: 'Основная профессиональная деятельность: \r\n\r\n- Разработка договорных схем, алгоритмов совершения сделок в рамках проектов, осуществляемых компанией.\r\n- Составление, правовая экспертиза, согласование договоров, соглашений, протоколов разногласий, корпоративных документов.\r\n- Работа с различными документами на английском языке.\r\n- Правовая экспертиза конкурсной документации, государственных контрактов, юридическое сопровождение проектов, связанных с исполнением обязательств перед государственными заказчиками.\r\n- Претензионно-исковая работа, представление интересов организации в суде и Федеральной антимонопольной службе.\r\n- Осуществление консультаций, в т.ч. по сложным и нетиповым ситуациям, возникающим при взаимодействии с контрагентами.\r\n- Разработка концептуальных подходов компании и проработка юридических схем, направленных на корректную передачу интеллектуальных прав при заключении сделок и ведении проектов.\r\n- Участие в совещаниях, переговорах с контрагентами, в т.ч. клиентами компании.\r\n- Ведение проектов в области социальной рекламы на телевидении (в т.ч. на центральных телеканалах), в интернете, разработка схем заключения договоров, направленных на изготовление и размещение социальной рекламы.\r\n- Взаимодействие с государственными органами \r\n- Участие в конференциях, собраниях, иных мероприятиях в сфере охраны интеллектуальной собственности.\r\n- Составление деловых писем (в т.ч. на английском языке).\r\n- Самостоятельное ведение проектов, в т.ч. с иностранными партнерами. В 2009 г. работал в качестве координатора между Сенаторским клубом Совета Федерации Федерального собрания РФ и Ассоциацией аккредитованных лоббистов при Европейском парламенте (Association of the accredited lobbysts to the Europian Parliament) в целях согласования партнерского соглашения между данными организациями, что предполагало согласование текста соглашения и ведение переговоров на английском и русском языке.\r\n\r\nОкончил различные курсы английского языка, в том числе Anglo-Continental school (Борнмут, Великобритания) и специализированные курсы, направленные на обучение составлению юридических документов, а также изучение юридической лексики в сфере интеллектуальной собственности.\r\n',
