        aWahm6WPvdWRfXfW11W49N: 'Основная практика сосредоточена на секторе недвижимость, в том числе сделках, финансах, приобретении и распоряжении активами, а также их развитии, урегулировании споров, получении разрешительной документации. Консультирую заемщиков и кредиторов по всем видам операций с недвижимостью, включая ипотечные, строительные, кредитные и другие структурированные сделки.\r\n\r\nПредставлю интересы клиентов в судах, при отчуждении и обременении прав, спорах с застройщиками, управляющими компаниями и прочих сделках. Консультирую девелоперов, разрабатываю механизмы привлечения денежных средств в строительство, а также консультирую по долевым сделкам в сфере строительства, приобретении активов на вторичном рынке.\r\n\r\nПредставлял интересы различных клиентов как физических лиц, так и компании включая, МСД Групп Нидерланды, Тверская файненс БВ, Ренессанс капитал, Найт Френк, Фонд РЖС, МГТС, ВТБ Капитал, ФАНО России, Совкомбанк, Мосинжпроект и других.',
