        dcGYaZW4XcL4kRuCkRWRDK: 'Гражданско-правовая\r\nСопровождение сделок с недвижимым имуществом:\r\n•\tЮридическая экспертиза объектов недвижимости (due diligence);\r\n•\tСопровождение инвестиционных проектов в области строительства жилой и коммерческой недвижимости, в том числе разработка договорных структур, подготовка инвестиционных договоров, договоров о совместной деятельности, договоров подряда, иных соглашений;\r\n•\tКомплексное сопровождение сделок по приобретению жилой и коммерческой недвижимости в России, Великобритании, странах Евросоюза, Болгарии, США и странах Африки;\r\n•\tРазработка строительной контрактной документации, сопровождение контрактов и юридическое консультирование строительных проектов;\r\n•\tСопровождение арендного бизнеса, подготовка арендных соглашений.\r\nСопровождение сделок и инвестиционных проектов:\r\n•\tСопровождение сделок по продаже/приобретению акций/долей в девелоперских и строительных компаниях, а также привлечению финансовых инвесторов (M& A);\r\n•\tРазработка оптимальных целевых структур владения, управления и операционных структур групп компаний, осуществляющих деятельность в указанной сфере, с целью уменьшения рисков и повышения степени защиты активов;\r\nСопровождение споров в сфере недвижимости:\r\n•\tПредставление интересов в российских судах по всем вопросам законодательства в сфере недвижимости, в том числе сопровождение споров, связанных с приватизацией, земельными правоотношениями, строительством, куплей-продажей или арендой недвижимости и т. д.;\r\n•\tДосудебные процедуры урегулирования конфликтов, медиация.\r\nНалоговое консультирование и сопровождение налоговых споров:\r\n•\tСудебное и досудебное оспаривание претензий налоговых органов как по общим, так и частным вопросам отрасли;\r\n•\tСопровождение налоговых проверок, анализ налоговых рисков, полноты применения льгот и рисков наличия трансфертного ценообразования.\r\n',
