        aWahm6WPvdWRfXfW11W49N: 'Образование – Московский государственный областной университет (1998-2003), гражданско-правовая специализация, дневная, очная.\r\nЯ специалист по юридическому сопровождению и защите бизнеса, связанного с:\r\n- создания и извлечения прибыли от интеллектуальной собственности (видео, тексты, изображения, товарные знаки и т.д.);\r\n - детским развитием и образованием;\r\n- медиа и Интернет.\r\nТакже осуществляю сопровождение бизнеса и решение гражданско-правовых вопросов. \r\nЯ выстраивал и осуществлял юридическую работу во франчайзинговых сетях Бэби-клуб, Чемпионика, ПроТанцы, Точка Роста, Шаробот; сопровождал бизнес блогеров, дизайнеров, медиа-ресурсов (mel.fm, stihi.ru).\r\nЯ могу быть полезен, в том числе потому, что:\r\n- знаю как и могу самостоятельно создать или изменить существующий договор, в том числе аренды, услуг, подряда, поставки и т.п., чтобы он был понятен и отвечал интересам обеих сторон, но в первую очередь защищал бизнес и права моего клиента/работодателя.\r\n- выстраиваю такую систему документального закрепления отношений между франчайзером и франчайзи, при которой каждый франчайзи понимает и соглашается с условиями франшизы, а собственник бренда защищен от последствий некачественной работы и негативных действий своего партнера, в том числе после расторжения франчайзингового договора.\r\n- могу подготовить владельца детского центра/сада к прохождению проверки Роспотребнадзором, МЧС и Минобразования и помочь получить образовательную лицензию.\r\n- могу предостеречь арендатора от рисков при заключении договора аренды.\r\n- эффективно организовываю и веду претензионную и судебную работу как со стороны выставляющей требования (Истца), так и со стороны, отвечающей на эти требования (Ответчик). Имею положительную практику ведения дел, связанных с нарушениями прав на объекты интеллектуальной собственности, взысканием дебиторской задолженности, роялти и других.\r\n- самостоятельно осуществляю юридическую защиту бизнеса, обозначая риски собственнику и сводя их к минимуму, разъясняю сотрудникам и контрагентам о возможностях и ограничениях в силу закона и договорных отношений и предлагаю наиболее безопасные и экономически выгодные пути работы по реализации договора.\r\nЕсть статус индивидуального предпринимателя.\r\n',
